window.bookSummaryJSON = "<p>In No Man’s Circus, the Ringmaster controls everything–even me.</p> <p>Every evening, I’m forced to perform. High above a crowd of supernaturals, I fly on my lyra. Never high enough to escape my captor.</p> <p>And when the lights go down and the audience goes home, it’s just him and me.</p> <p>I shouldn’t enjoy it.</p> <p>This obsession he has with me.</p> <p>But as a hybrid in a world where power is king, I’m nothing special. Except when his eyes are on my body.</p> <p>He’s a beast whose strength is unparalleled, a creature who demands my obedience. But even as the twisted parts of me are drawn to him, I refuse to be broken.</p> <p>He’ll have to kill me first.</p> <p><i>Slay Me</i> is the ninth audiobook in the Immortal Vices and Virtues world. It is a steamy standalone paranormal romance set in the Immortal Vices and Virtues world. Every audiobook is a guaranteed happily ever after with a satisfying ending and no cliffhangers. For mature listeners 18+ due to language, sexual situations, and violence.</p>"; 
